import { combineReducers } from "redux";
import visions from "./visions";
import clos from "./clos";
import plos from "./plos";
import subjects from "./subjects";
import auth from "./auth";
export default combineReducers({
  visions,
  clos,
  plos,
  subjects,
  auth
});
